void SayInChat(const char *text)
{
	char buffer[250];
	sprintf_s(buffer, "say \"%s\"", text);
	INTERFACES::Engine->ClientCmd(buffer);
}

inline void SetName(const char* new_name)
{
	static auto name = INTERFACES::cvar->FindVar("name");

	name->SetValue(new_name);
	*reinterpret_cast<int*>(uintptr_t(&name->fnChangeCallback) + 0xC) = 0;
}

void RankReveal(SDK::CUserCmd* cmd)
{
	if (!SETTINGS::settings.rankreveal)
		return;

	if (!fnReveal)
		fnReveal = (RevealAllFn)UTILS::FindPattern(XorStr("client.dll"), (PBYTE)XorStr("\x55\x8B\xEC\x8B\x0D\x00\x00\x00\x00\x68\x00\x00\x00\x00"), XorStr("xxxxx????x????"));

	int iBuffer[1];

	if (cmd->buttons & IN_SCORE)
		fnReveal(iBuffer[1]);
}




